import styled from 'styled-components';
import * as GS from '../../styles/global';
import { motion } from 'framer-motion';

export const BlogContainer = styled(GS.FlexEven)`
	& > div:nth-child(1) {
		border: 0.1rem solid #000;
		flex: 1.5;
	}
	& > div:nth-child(2) {
		border: 0.1rem solid #000;
		flex: 1;
	}
`;
